import bisect
class Solution:
    # def advantageCount(self, A: List[int], B: List[int]) -> List[int]:
    def advantageCount2(self, A, B):

        n = len(A)
        res = []
        
        for b in B:
            diff = [a - b for a in A]
            diff_greater_than_zero = False
            dn = len(diff)
            for i in range(dn):
                if diff[i] > 0:
                    diff_greater_than_zero = True
                    mn = diff[i]
                    min_idx = i
                    break

            if diff_greater_than_zero:
                if mn != 1:
                    for i in range(min_idx, dn):
                        if 0 < diff[i] < mn:
                            mn = diff[i]
                            min_idx = i
                            if mn == 1:
                                break
                    # min_diff = min(l)
                    # min_idx = diff.index(min_diff)
            else:
                mn = min(A)
                min_idx = A.index(mn)


            res.append(A[min_idx])

            A = A[:min_idx] + A[min_idx+1:]

        
            
        # print(res)


        return res

    def advantageCount(self, A, B):

        n = len(A)
        res = []
        A.sort()
        d = {i:True for i in range(n)}
        for b in B:
            pos = bisect.bisect_left(A, b)    
            # print(b, pos, d)
            while pos < n and (not d[pos] or A[pos % n] <= b):
                pos += 1
            if pos == n:    
                pos = 0
                while pos < n and not d[pos]:
                    print('here')
                    pos += 1
                res.append(A[pos])
                d[pos] = False
            else:
                res.append(A[pos])
                d[pos] = False
            # else:
                # todo
            # print(pos)
            
        # print(res)
        return res

